import React, { useState, useEffect } from 'react';
const ViewDashboard = () => {
    const [users, setUsers] = useState([]);
    const [transaction, setTransaction] = useState([]);
    useEffect(() => {
        fetchusers();
        fetchTransaction();
    }, []);


    const fetchTransaction = async () => {
        try {
            const response = await fetch('http://127.0.0.1:8000/dashboard/transaction/'); 
            if (!response.ok) {
                throw new Error('Failed to fetch transaction');
            }
            const data = await response.json();
            setTransaction(data);
        } catch (error) {
            console.error('Error fetching transaction:', error);
        }
    };
    const fetchusers = async () => {
        try {
            const response = await fetch('http://127.0.0.1:8000/dashboard/users/'); 
            if (!response.ok) {
                throw new Error('Failed to fetch users');
            }
            const data = await response.json();
            setUsers(data);
        } catch (error) {
            console.error('Error fetching users:', error);
        }
    };
    console.log('users:', users);
    console.log('transaction:', transaction);
    return (
        <div className="main-content">

        <div className="page-content">
            <div className="container-fluid">

                <div className="row">
                    <div className="col-12">
                        <div className="page-title-box d-sm-flex align-items-center justify-content-between">
                            <h4 className="mb-sm-0 font-size-18">Users</h4>
                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col-xl-4">
                        <div className="card">
                            <div className="card-body">
                                <h4 className="card-title mb-4">Transactions</h4>

                                <div className="tab-content mt-4">
                                    <div className="tab-pane active" id="transactions-all-tab" role="tabpanel">
                                    <div className="table-responsive" data-simplebar style={{maxHeight: '330px'}}>
                                        <table className="table align-middle table-nowrap">
                                        <tbody>
                                        {transaction.map(order => (
                                <tr key={t.id}>
                                            <td style={{width: '50px'}}>
                                                <div className="font-size-22 text-success">
                                                <i className="bx bx-down-arrow-circle"></i>
                                                </div>
                                            </td>
                            
                                            <td>
                                                <div>
                                                <h5 className="font-size-14 mb-1">Buy BTC</h5>
                                                <p className="text-muted mb-0">14 Mar, 2020</p>
                                                </div>
                                            </td>
                            
                                            <td>
                                                <div className="text-end">
                                                <h5 className="font-size-14 mb-0">0.016 BTC</h5>
                                                </div>
                                            </td>
                            
                                            <td>
                                                <div className="text-end">
                                                <h5 className="font-size-14 text-muted mb-0">${t.am}</h5>
                                                </div>
                                            </td>
                                            </tr>
                                             ))}
                                        </tbody>
                                        </table>
                                    </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>

        <div className="row">
            <div className="col-12">
                <div className="card">
                    <div className="card-body">

                        {/* Table Section */}
                        <div className="table-responsive">
                            <table className="table align-middle table-nowrap table-check">
                                <thead className="table-light">
                                    <tr>
                                    <th className="align-middle">User ID</th>
                                    <th className="align-middle">Username</th>
                                    <th className="align-middle">Phone</th>
                                    <th className="align-middle">Email</th>
                                    <th className="align-middle">Address</th>

                                    </tr>
                                </thead>
                                <tbody>{users.map(user => (
                                <tr key={user.id}>
                                    
                                    <td><a href="javascript: void(0);" className="text-body fw-bold">#{user.id}</a></td>
                                    <td>{user.username}</td>
                                    <td>{user.address && user.address.phone ? user.address.phone : 'N/A'}</td>
                                    <td>{user.email}</td>
                                    <td>
                                    {user.address && (
                                    <div>
                                        <p>Country: {user.address.country}</p>
                                        <p>City: {user.address.city}</p>
                                        <p>Street Address: {user.address.street_address}</p>
                                        <p>Zipcode: {user.address.zipcode}</p>
                                    </div>
                                )}
                                    </td>
                                    
                                </tr>
                            ))}
                                </tbody>
                            </table>
                        </div>

                        {/* Pagination Section */}
                        <ul className="pagination pagination-rounded justify-content-end mb-2">
                            {/* Pagination Items */}
                        </ul>
                    </div>
                </div>
            </div>
        </div>
        </div> 
    </div>

    
    <footer className="footer">
        <div className="container-fluid">
            <div className="row">
                <div className="col-sm-6">
                    <script>document.write(new Date().getFullYear())</script> © React Dashboard.
                </div>
                <div className="col-sm-6">
                    <div className="text-sm-end d-none d-sm-block">
                        Design & Develop by Sarfas
                    </div>
                </div>
            </div>
        </div>
    </footer>
</div>




    );
};

export default ViewDashboard;
